import React from "react";
import "./App.css";
import TradingViewWidget from "./Charts/tradingview-widget/TradingviewWidget";

function App() {
  return (
    <div>
      <div style={{ height: 850 }}>
        <TradingViewWidget />
      </div>
      <div className="mt-3">
        <div className="row">
          <div className="col-9">
          </div>
          <div className="col-3">
            <div className="row">
              <div className="col-6">
                <button type="button" className="btn btn-primary">Start</button>
              </div>
              <div className="col-6">
                <button type="button" className="btn btn-dark">End</button>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
